1. Set up a new Rust project:
   - Open a terminal and navigate to the directory where you want to create your project.
   - Run the following command to create a new Rust project:
     ```
     cargo new tts_app
     ```
   - Change into the project directory:
     ```
     cd tts_app
     ```

2. Add the necessary dependencies to your `Cargo.toml` file:
   ```toml
   [dependencies]
   reqwest = { version = "0.11", features = ["json"] }
   serde = { version = "1.0", features = ["derive"] }
   serde_json = "1.0"
   clipboard = "0.5"
   ```

3. Create a new file named `elevenlabs.rs` in the `src` directory and add the following code:
   ```rust
   use reqwest::Client;
   use serde::{Deserialize, Serialize};
   use std::env;

   #[derive(Serialize)]
   struct TTSRequest<'a> {
       text: &'a str,
       voice_id: &'a str,
       #[serde(rename = "api_key")]
       api_key: &'a str,
   }

   #[derive(Deserialize)]
   struct TTSResponse {
       audio_url: String,
   }

   pub async fn synthesize_speech(text: &str, voice_id: &str) -> Result<String, reqwest::Error> {
       let api_key = env::var("ELEVENLABS_API_KEY").expect("ELEVENLABS_API_KEY must be set");
       let client = Client::new();
       let request = TTSRequest {
           text,
           voice_id,
           api_key: &api_key,
       };

       let response = client
           .post("https://api.elevenlabs.io/synthesize")
           .json(&request)
           .send()
           .await?;

       let tts_response: TTSResponse = response.json().await?;
       Ok(tts_response.audio_url)
   }
   ```

