### 2.2 思路

- 遍历数组,记录当前遇到的最小价格 `minPrice`。
- 计算当前价格与最小价格之差,如果大于当前最大利润 `maxProfit`,则更新 `maxProfit`。
- 遍历结束后,`maxProfit` 即为最大利润。

### 2.3 复杂度分析

- 时间复杂度:O(n),其中 n 为数组的长度。只需遍历一次数组。
