function packEntities(entities) {
  const numEntities = entities.length;
  const buffer = new ArrayBuffer(Math.ceil((numEntities * 7) / 8));
  const view = new DataView(buffer);

  let offset = 0;
  let currentByte = 0;
  let bitsUsed = 0;

  for (let i = 0; i < numEntities; i++) {
    const entity = entities[i];
    const id = entity.id & 0xf;
    const size = entity.size & 0x7;

    currentByte |= id << bitsUsed;
    bitsUsed += 4;

    if (bitsUsed === 8) {
      view.setUint8(offset++, currentByte);
      currentByte = 0;
      bitsUsed = 0;
    }

    currentByte |= size << bitsUsed;
    bitsUsed += 3;

    if (bitsUsed >= 8) {
      view.setUint8(offset++, currentByte);
      currentByte = size >> (8 - bitsUsed);
      bitsUsed -= 8;
    }
  }

  if (bitsUsed > 0) {
    view.setUint8(offset, currentByte);
  }

  return buffer;
}

function unpackEntities(buffer) {
  const view = new DataView(buffer);
  const entities = [];

  let offset = 0;
  let currentByte = 0;
  let bitsUsed = 0;

  while (offset < buffer.byteLength) {
    if (bitsUsed === 0) {
      currentByte = view.getUint8(offset++);
    }

    const id = (currentByte >> bitsUsed) & 0xf;
    bitsUsed += 4;

    if (bitsUsed === 8) {
      currentByte = view.getUint8(offset++);
      bitsUsed = 0;
    }

    let size = (currentByte >> bitsUsed) & 0x7;
    bitsUsed += 3;

    if (bitsUsed >= 8) {
      const nextByte = view.getUint8(offset++);
      size |= (nextByte << (8 - bitsUsed)) & 0x7;
      currentByte = nextByte;
      bitsUsed -= 8;
    }

    entities.push({ id, size });
  }

  return entities;
}
