Certainly! Here's an example of how you might represent the Metal Shading Language's abstract syntax tree (AST) using Swift structs:

```swift
enum DataType {
    case void
    case bool
    case int
    case uint
    case float
    case double
    case vector(type: DataType, size: Int)
    case matrix(type: DataType, rows: Int, columns: Int)
    case structType(name: String)
    case array(type: DataType, size: Int)
    case sampler
    case texture(type: DataType, dimension: Int)
}

struct VariableDeclaration {
    let dataType: DataType
    let name: String
    let initialValue: Expression?
}

struct FunctionDeclaration {
    let returnType: DataType
    let name: String
    let parameters: [VariableDeclaration]
    let body: CompoundStatement
}

struct Expression {
    // Various expression types (e.g., binary, unary, literal, etc.)
    // ...
}

struct Statement {
    // Various statement types (e.g., assignment, if, for, while, etc.)
    // ...
}

struct CompoundStatement {
    let statements: [Statement]
}

struct StructDeclaration {
    let name: String
    let members: [VariableDeclaration]
}

struct AST {
    let declarations: [Declaration]
}

enum Declaration {
    case variableDeclaration(VariableDeclaration)
    case functionDeclaration(FunctionDeclaration)
    case structDeclaration(StructDeclaration)
}
```

